using NUnit.Framework;
using System;
using System.Text;
using System.Threading.Tasks;

namespace Frends.Community.MultipartParser.Tests
{
    [TestFixture]
    class TestClass
    {
        private readonly static string requestBody = "";

        private readonly static string firstFile = "ew0KICAgICJlbXBsb3llZSI6IHsNCiAgICAgICAgIm5hbWUiOiAiQWxiZXJ0IEVpbnN0ZWluIiwNCiAgICAgICAgInF1b3RlIjogIkluc2FuaXR5OiBkb2luZyB0aGUgc2FtZSB0aGluZyBvdmVyIGFuZCBvdmVyIGFnYWluIGFuZCBleHBlY3RpbmcgZGlmZmVyZW50IHJlc3VsdHMuIg0KICAgIH0NCn0=";
        private readonly static string secondFile = "";

        [Test]
        public async Task ThreeMultipartTaskss()
        {
            var input = new Input
            {
                ByteArray = Convert.FromBase64String(requestBody),
            };

            var ret = await MultipartTasks.ParseMultipartBase64body(input, new System.Threading.CancellationToken());

            Assert.That(Convert.ToBase64String(ret.Files[0].Contents), Is.EqualTo(firstFile));
            Assert.That(Convert.ToBase64String(ret.Files[1].Contents), Is.EqualTo(secondFile));
            Assert.That(ret.Parameters[0].Name, Is.EqualTo("username"));
            Assert.That(ret.Parameters[0].Value, Is.EqualTo("example"));
            Assert.That(ret.Parameters[1].Name, Is.EqualTo("email"));
            Assert.That(ret.Parameters[1].Value, Is.EqualTo("example@example.com"));
        }
    }

}
